import React from 'react'
import {Card,Image} from "antd";

const PostCard = ({post}) =>{
    return(
      <div>
          <Card
              cover={post.Images[0] && <PostImages i/>}
          >
              <Image/>
              <Content/>
              <Buttons></Buttons>
          </Card>
          <CommentForm/>
          <Comments/>
      </div>
    );
};

export default PostCard;
